import ExpenseItem from "./Components/ExpenseItem";

function App() {
  const expenses = [
    { date: new Date(2022, 10, 17), title: "Car Insurance", amount: 458.96 },
    { date: new Date(2022, 10, 16), title: "Food", amount: 1858.96 },
    { date: new Date(2022, 10, 15), title: "Rent", amount: 590.96 },
    { date: new Date(2022, 10, 14), title: "Gym", amount: 128.96 },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        date={expense[0].date}
        title={expense[0].title}
        amount={expense[0].amount}
      ></ExpenseItem>
      <ExpenseItem
        date={expense[1].date}
        title={expense[1].title}
        amount={expense[0].amount}
      ></ExpenseItem>
      <ExpenseItem
        date={expense[0].date}
        title={expense[0].title}
        amount={expense[0].amount}
      ></ExpenseItem>
      <ExpenseItem
        date={expense[0].date}
        title={expense[0].title}
        amount={expense[0].amount}
      ></ExpenseItem>

    </div>
  );
}

export default App;
